let scrollPercentage=()=>{let scrollProgress=document.getElementById("progress");let progressValue=document.getElementById("progress-value");let pos=document.documentElement.scrollTop;let calcHeight=document.documentElement.scrollHeight-document.documentElement.clientHeight;let scrollValue=Math.round(pos*100/calcHeight);scrollProgress.style.background=`conic-gradient(#ff7d6a ${scrollValue}%, #222 ${scrollValue}%)`;progressValue.textContent=`${scrollValue}%`;let indicator=document.querySelector(".indicator");let documentHeight=document.documentElement.scrollHeight;let viewportHeight=document.documentElement.clientHeight;let percent=(scrollY/(documentHeight-viewportHeight))*100;indicator.style.width=percent+"%"}
window.onscroll=scrollPercentage;window.onload=scrollPercentage